import React from "react";
import "./App.css";

import List from "./componets/List";

class App extends React.Component {
  state = {
    user1: [
      {
        text: "foo",
      },
      {
        text: "bar",
      },
    ],
    user2: [
      {
        text: "ok",
      },
    ],
    user3: [
      {
        text: "asdiohdasidh",
      },
    ],
    user4: [
      {
        text: "asdiohdasidh",
      },
    ],
  };

  render() {
    return (
      <div className="App">
        <div>
          <div>
            <div className="user1">
              <h2 className="name">Bob</h2>
            </div>
            <List blocktext={this.state.user1} />
          </div>
          <div>
            <div className="user2">
              <h2 className="name">Bob</h2>
            </div>
            <List blocktext={this.state.user2} />
          </div>
          <List blocktext={this.state.user2} />
        </div>
      </div>
    );
  }
}

export default App;
